import React, { Component } from 'react';
import Chekbox from './chekboxhtml/chekboxhtml';

class Checkbox extends Component {
    constructor(props)
    {
        super(props)
        this.state = {
           chekboxarray: [
              {
                  class: '',
                  checked: true,

              }
            ],
        }
    }
    render() {

        return (
            <>
              <Chekbox Checkbox={this.state.chekboxarray}/>
            </>
        );
    }
}

export default Checkbox;
